import React from 'react';

const Track = (props) => {
    const { track } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">
                        <strong><i className="fas play"> Track</i></strong>: {track}
                    </p>
                </div>
            </div>

        </div>
    )
}
export default Track;
